import React from 'react';
import {
  BrowserRouter,
  Routes,
  Route,
  createBrowserRouter,
  RouterProvider,
} from 'react-router-dom';

import './App.scss';

import Browse from './pages/browse/Browse';
import Search from './pages/search/Search';

const router = createBrowserRouter([
  {
    path: '/',
    element: <Browse />,
  },
]);
////
function App() {
  return (
    <>
      <RouterProvider router={router} />
    </>
  );
}
export default App;
